import { Text } from '../components/Language/Language';

import Navbar from '../components/Navbar';
import Details from '../components/Recipe/Details';

function Main({match, id}) {
    return (
        <div>
            <Navbar />
            <h1><Text t="main-title" /></h1>
            <Details id={id}/>
        </div>
    );
}

export default Main;
